import React, { Component } from "react";
import ReactDOM from "react-dom";
import { Col } from "reactstrap";
import photo from "../../_assets/images/photo.jpg";
import Organisation from "../../pages/dashboard/browsers/Organisation";
import Systems from "../../pages/dashboard/browsers/Systems";

export default class Header extends Component {
  constructor(props) {
    super(props);
    this.state = {
      panelIndex: 0
    };
  }

  getBtnId = e => {
    if (e.target && e.target.nodeName == "BUTTON") {
      console.log(e.target);
      this.setState({
        panelIndex: Number(e.target.id)
      });
    }
  };

  render() {
    return (
      <div className="container-fluid">
        <HelpMenu getBtnId={this.getBtnId} />
        <HelpPanels panelIndex={this.state.panelIndex} />
      </div>
    );
  }
}
const HelpMenu = ({ getBtnId }) => {
  return (
    <div className="dashboard-header">
      <div className="d-flex text-white">
        <Col md="3">
          <ul  className="first-menu btnGroup" onClick={getBtnId}>
            <li>
            <button id="0"><span className="icon icon-Users menu-icon" /></button>
            </li>
            <li>
              <button>
              <button id="1"><span className="icon icon-Users menu-icon" /></button>
                <span className="icon icon-EmptyBox menu-icon" />
              </button>
            </li>
          </ul>
        </Col>
        <div className="col-md-4">
          <ul className="second-menu">
            <li>
              <button>
                <span className="icon icon-Floppy menu-icon" />
              </button>
            </li>
            <li>
              <button>
                <span className="icon icon-User menu-icon" />
              </button>
            </li>
            <li>
              <button>
                <span className="icon icon-FileBox menu-icon" />
              </button>
            </li>
            <li>
              <button>
                <span className="icon icon-Share menu-icon" />
              </button>
            </li>
          </ul>
        </div>
        <div className="col-md-1">
          <ul className="third-menu">
            <li>
              <button>
                <span className="icon icon-WorldWide menu-icon" />
              </button>
            </li>
          </ul>
        </div>
        <div className="col-md-4">
          <ul className="fourth-menu">
            <li>
              <button>
                <img src={photo} alt="starlify" className="photo-icon" />
              </button>
            </li>
            <li className="user-avatar">
              Entiros <i class="fas fa-chevron-down m-l-15" />
            </li>
            <li>
              <button>
                <span className="icon icon-Search menu-icon" />
              </button>
            </li>
          </ul>
        </div>
      </div>
      <div className="content d-flex">
        <div className="organisationVisible col-md-4">
          <Organisation />
        </div>
        <div className="systemVisible col-md-4">
          <Systems />
        </div>
      </div>
      <div className="btnGroup" onClick={getBtnId}>
        <button id="0">Option 1</button>
        <button id="1">Option 2</button>
        <button id="2">Option 3</button>
        <button id="3">Option 4</button>
      </div>
    </div>
  );
};

class HelpPanels extends React.Component {
  render() {
    const panels = [
      <HelpPanel1 />,
      <HelpPanel2 />,
      <HelpPanel3 />,
      <HelpPanel4 />
    ];
    const correctPanel = panels[this.props.panelIndex];
    return <div className="panel-box">{correctPanel}</div>;
  }
}

const HelpPanel1 = () => <h1>Panel for Option 1</h1>;
const HelpPanel2 = () => <h1>Panel for Option 2</h1>;
const HelpPanel3 = () => <h1>Panel for Option 3</h1>;
const HelpPanel4 = () => <h1>Panel for Option 4</h1>;
